Let's talk bad skin days.

For the last month or so, my skin has been breaking out like crazy. Most recently, I've had majorrrr cystic acne. At first I was frustrated and annoyed about it, but then I decided not to let it affect me. Is it annoying? Absolutely! But my skin is just going through it right now, and that's okay. I try to eat the right foods, drink lots of water, and exercise, but sometimes bad skin days just happen. I know that not letting it affect you is easier said than done, but sometimes you just have to let it ride out and heal itself. (Obviously, sometimes it's too severe for that and a dermatologist visit needs to happen)

Moral of this story, a bad skin day, week, or month shouldn't ruin your mood or affect your days. Flaws are what make you human, and flaws are beautiful! If you feel like your bad skin days are out of control, see a doctor and get prescribed something to help it.

Just wanted to share my skin struggles with anyone it might resonate with. I know I've grown up in a world where acne and breakouts were the worst possible thing to happen to a kid, but newsflash: it's perfectly normal and okay! 

Have a great day everyone 💗

